/**
 * @param {number[]} nums
 * @return {number}
 */
var specialPerm = function(nums) {
    const mod = 1e9 + 7;
    const n = nums.length;
    const dp = Array(1 << n).fill(0);
    const valid = Array.from({ length: n }, () => new Array(n).fill(0));

    for (let i = 0; i < n; ++i) {
        for (let j = 0; j < n; ++j) {
            if (nums[i] % nums[j] === 0 || nums[j] % nums[i] === 0) {
                valid[i][j] = 1;
            }
        }
    }

    dp[0] = 1;
    for (let mask = 1; mask < (1 << n); ++mask) {
        for (let i = 0; i < n; ++i) {
            if ((mask & (1 << i)) === 0) continue;
            const prevMask = mask ^ (1 << i);
            if (dp[prevMask] === 0) continue;
            for (let j = 0; j < n; ++j) {
                if (i !== j && (mask & (1 << j)) && valid[i][j]) {
                    dp[mask] = (dp[mask] + dp[prevMask]) % mod;
                    break;
                }
            }
        }
    }

    return dp[(1 << n) - 1];
};
